      <div className="containerInput">
        <input type="text" placeholder="Digite seu CEP" value={input}></input>
        <button className="buttonSearch"><FiSearch size={25} color="FFF"/></button>
      </div>

      <main className="main">
        <h2>CEP: 47850-000</h2>
        <span>Rua Pará</span>
        <span>Complemento: Quadra 07 Lote 19</span>
        <span>Centro</span>
        <span>Luís Eduardo Magalhães - BA</span>
      </main>
    </div>
  );
}

export default App;
